  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes this year's vegetation
  survey on the moist soil units of Clarence Cannon National Wildlife Refuge. The
  history of farming on refuges is long and varied and has evolved around a cooperative
  farming program whereby the refuge receives either one-third or one-fourth of the
  crop grown or a comparable value substitute for its share. The logic behind this
  type of farming is in our receiving a share which costs us only in administration.
  This report evaluates cropland production on Mark Twain, Shiawasee, Ottawa and Crap
  Orchard NWR\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
